import React from "react";

const Counter = () => {
  const [count, setCount] = React.useState(0);
  let plus = () => {
    setCount(1 )
  };

  return (
    <div className="count">
      <button className="count-minus">-</button>
      <div className="counter--count">
        <h1>{count}</h1>
      </div>
      <button className="count-plus" onClick={plus}>
        +
      </button>
    </div>
  );
};
export default Counter;
